// src/components/Home.js
import React from 'react';
import './Home.css';

const Home = ({ userType }) => {
    return (
        <div className="home-container">
            <h1>Welcome to Knock Nok</h1>
            <p>{userType === 'user' ? 'Find and book professional services easily!' : 'Manage your jobs and grow your work!'}</p>
        </div>
    );
};

export default Home;
